Here is a step-by-step guide to creating a React,Node, and Express.js web app for creating, adding dummy data, and showing it. I'll also cover how to deploy the code after creating a build.

**Step 1: Create a new React app**

Open your terminal and run the following command to create a new React app:
```
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node and Express.js server**

In the same terminal, navigate to the `my-app` directory and run the following command to create a new Node and Express.js server:
```
npm init -y
npm install express
```
This will create a new `package.json` file and install Express.js.

**Step 3: Create a new file for the server**

Create a new file called `server.js` in the `my-app` directory and add the following code:
```
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let data = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
  { id: 3, name: 'Bob Smith', age: 40 },
];

app.get('/api/data', (req, res) => {
  res.json(data);
});

app.post('/api/data', (req, res) => {
  const newData = req.body;
  data.push(newData);
  res.json(data);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code sets up an Express.js server that listens on port 3001 and has two endpoints: `/api/data` for getting the data and `/api/data` for posting new data.

**Step 4: Create a new file for the React app**

Create a new file called `App.js` in the `my-app` directory and add the following code:
```
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);
  const [newData, setNewData] = useState({ name: '', age: '' });

  useEffect(() => {
    axios.get('http://localhost:3001/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();
    axios.post('http://localhost:3001/api/data', newData)
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div>
      <h1>Data</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>{item.name} ({item.age})</li>
        ))}
      </ul>
      <form onSubmit={handleSubmit}>
        <label>
          Name:
          <input type="text" value={newData.name} onChange={(event) => setNewData({ ...newData, name: event.target.value })} />
        </label>
        <label>
          Age:
          <input type="number" value={newData.age} onChange={(event) => setNewData({ ...newData, age: event.target.value })} />
